import React, { Component } from "react";

class useritem extends Component {
  constructor() {
    super();
    this.state = {
      id: "id",
      login: "theOnlyihao",
      avatar_url:
        "https://gravatar.com/avatar/2a0bc7fd7fa6c3f5b5fc705783d21426?s=400&d=robohash&r=x",
      html_url: "https://github.com/theOnlyihao",
    };
  }
  render() {
    return (
      <div className="card text-center">
        <img
          src={this.state.avatar_url}
          alt=""
          className="round-img"
          style={{
            width: "60px",
          }}
        />
        <h3>{this.state.login}</h3>

        <div>
          <a
            href={this.state.html_url}
            className="btn btn-dark btn-sm my-1"
          ></a>
        </div>
      </div>
    );
  }
}

export default useritem;
